/************************* IMPLEMENTATION OF Heuristic ************************/

extern "C" Heuristic* new_heuristic() {
    return new conrner_scratches512();
}

unsigned int conrner_scratches512::dim() {
    return 4096;
}


void conrner_scratches512::prepareForCoordinates() {
    unsigned int x0 = coordinates.x - roi_extent;
    unsigned int y0 = coordinates.y - roi_extent;
    unsigned int roi_size = roi_extent * 2 + 1;
         
    RGBPixel_t** pLines = image->rgbLines();
    
    float D_[512];
    float patch[108];
    float petch[108];
    
    std::fill_n(&fist_[0], 8*512, 0.0f);
    
    unsigned int dindx;
    if (roi_size < 32) dindx = roi_size - 5;
    else dindx = 27;
    
    for (unsigned int y = 0; y < dindx; ++y) {
        for (unsigned int x = 0; x < dindx; ++x) {
            
            unsigned int pindx=0;
            if (y>dindx/2) pindx+=2*512;
            if (x>dindx/2) pindx+=512;
            
            float mefan = 0.0f, varf = 0.0f;
            
            for (unsigned int v = 0; v < 6; ++v) {
                for (unsigned int u = 0; u < 6; ++u) {
                    float r = pLines[y0 + y + v][x0 + x + u].r;
                    float g = pLines[y0 + y + v][x0 + x + u].g;
                    float b = pLines[y0 + y + v][x0 + x + u].b;
                    
                    mefan += r + g + b;
                    varf += r * r + g * g + b * b;
                    
                    patch[v * 6 + u] = r;
                    patch[36+v * 6 + u] = g;
                    patch[72+v * 6 + u] = b;
                }
            }
            
            mefan/=108.0f;
            varf=varf/107.0f - mefan*mefan*108.0f/107.0f;
            
            const float invSd = 1.0 / sqrt(10+varf); 
            
            for (int i = 0; i < 108; ++i) {
                petch[i] = ((patch[i] - mefan) *invSd)-M_[i];
                petch[i]=0;
            }
             
            for (int i = 0; i < 108; ++i) {
                for (int j = 0; j < 108; ++j) {
                    petch[i]+=patch[j]*P_[i][j];
                }
            }
            
            
            for (int i = 0; i < 512; ++i) {
                D_[i]=0.0f;
                for (int j = 0; j < 108; j++) D_[i]+=OPM_[i][j]*petch[j];
                fist_[pindx+i] += std::max(alpha-D_[i], 0.0f);
                fist_[4*512+pindx+i] += -std::max(-alpha-D_[i], 0.0f);
            }
             
        }
    }
    
    fhn=0.0f;
    for (int i = 0; i < 8*512; ++i) fhn+=fist_[i]*fist_[i];
    fhn=sqrt(fhn);

}




scalar_t conrner_scratches512::computeFeature(unsigned int feature_index) {
    
    return fist_[feature_index]/fhn;
}
